      "text": "17. Wo guter Art groffe Bohnen zum Sezen,und kleine weisse dito zum Kochen in billigemPreis zu haben, ist im Berichthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "18. Zwey Baretlein oder Professor Hüuth,wie auchein ganz neuer Castor Huth, mittelmäßigerGrosse, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "19. Bey Hrn. Burkhardt zum Riesen sind extraneue grosse Italianische Feigen, dito grosseMeertrauben mit und ohne Stiel, Haselnuß,durre Morcheln, feiner Chocoladen, alles inbilligem Preis zu haben."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "20. Zwölf Såck neuer Waizen in billigem Preis,im Berichthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "21. Bey Hrn. Jacob Grimm Buchbinder ist zuhaben: Ein Kriegs-Atlas von 65 theils LandKarten, Städten, Plans von Bataillen undBelagerungen des jezigen Kriegs. 2) DieWelt in einer Nuß mit Kupfern. 3) DieDurchlauchtige Welt, 4 Theil mit Waapen.4) Journal du Camp de Compiegne avec figures."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "22. Zwey saubere französische Bether in ein Wirths:Haus auf das Land oder in ein Bad dienlich,ohnentgeldtlich im Berichthans zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "23. Eine Behausung in der Aeschemer Vorstadtmit 4 Stuben, Kamunern samt einer grofsen Werkstatt, Effrig und einem schönen geswölbten Keller und Garten, weshalb sich beyHrn. Jacob Måglin dem Weinmann anzumelden."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "24. Ein Freund, welcher circa 600 Sester HanfSaamen anhero liefern könnte, mochte aberfolchen vorhero verkauft wissen, offeriet selbisgen dahero in billigem Preis, im Berichthauszu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "25. Wo guter alter weisser Wein zu haben, istbey Mitr. Michael Fuchs dem Kiefer zu vernehmen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "26. Circa 6. Saum extra guter alker pur rotherIdsteiner Wein, so gut als Neuenburger oderBurgunder, in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "27. Zwey Stücklein weissen Wein von 1760. 48 Pfund 10 s der Saum im einten, und à8 Pfund im andern, wovon nach Belieben zuhaben, im Berichthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "28. Ein Stock Heu ab z Thanen Matten vormRiechemer Thor oberhalb der Schorenbruck.Ferner ein Stücktein von 17 Saumen rothenBölliger Wein von 1760. schon roth und lauter, im Berichthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "29. Auf E. E. Zunft zum Båren sind wiederumneue Saure Rúben in billigem Preis zu haben."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "30. Ein roth Scharlachen Camisol und Hosen inbilligem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "31. Im Offenburger Hof ist wohlverwährterBau zu haben."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "32. Ein Brennhauslein bey der Steinen Mühlinmit aller Kommlichkeit, im Berichthaus ohneEntgeldt zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "33. Bey weme rother tund weisser Burgunder,wie auch Muscat Wein, Piecenweis wegenMangel Plazes, wie auch roth und weisser1753ger Margråfer Bein in billigem Preis zuhaben, ist im Berichthaus ohne Entgeldt zuerfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "34. Feine heitergelbe Hamburger Strick-Wollen,das Pfund à 6 Pfund, wo dieselbe Pfundweiszu haben, ist im Berichthaus ohne Entgeldt zuerfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "35. Herrn Holzach des Siegrists Behausung insSpiegelgåßlein mit 4 Stuben, 3 Kamunern ic.ist entweder zu verkaufen, oder famethaft zusverleihen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "36. Weisse umd rothe Margråfer Weine von1760. wovon in billigem Preis nach Beliebenzuhaben, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "37. Ein Mannensik in St. Peters Kirch auf demLetner. Item ein grün Tombeau Bethleinmit grünen wollenen Umhängen, in billigenPreis, im Berichthaus zu erfragen."
    },
    {
      "date": null,
      "tags_section": null,
      "text": "38. Ein Hausschlitten mit einem schönen Bildund Zugehördt in billigem Preis, im Berichts:haus zu erfragen."
